#### SERVER ####

server <- function(input, output,session) {
    
    # call the waitress
    waitress <- Waitress$
        new(theme = "overlay-percent")$
        start() # start
    
    for(i in 0:5){
        waitress$inc(10) # increase by 10%
        Sys.sleep(.3)
    }
    
    # hide when it's done
    waitress$close() 
    
    addClass(selector = "body", class = "sidebar-collapse")
    
#    import -----
    parolecnt <- fread('dataset/cantiche_conteggio_parole_apici_pyclean.csv')
    
    cantiche_versi <- fread('dataset/cantica_capitolo_verso_nofiltri_pyclean.csv')
    
    totversi <- cantiche_versi$rn_versi %>% max()-1
    totcanti <- cantiche_versi$rn_canto %>% max()
    
    ## remove stopwords
    library(stopwords)
    
    parole_clean <- parolecnt %>% 
        filter(!word %in% c(stopwords::stopwords("it", source = "snowball"),
                            stopwords::stopwords("it", source = "stopwords-iso"),
                            stopwords::stopwords("it", source = "nltk"),
                            'ch','sì','de','d','s','son','già','lor','poi','m',
                            'là','quando','né','fa','quel','qual','com','n',
                            'ché','or','t','v'
        )
        )
    #parole_clean %>% fwrite('../dataset/output/cantiche_conteggio_parole_apici_pyclean_swr.csv')
    
    library(wordcloud2)
    
    #parole_clean %>% names()
    names(parole_clean) <- c("cantica","word","freq","tf","idf","tf_idf")
    
    totparole <- parolecnt$n %>% sum()
    
    totparoledist <- parolecnt %>% summarize(totparoledist = n_distinct(word))
    
    ## conti versi per canto
    
    kpi_cantiche_canti <- cantiche_versi %>% 
        group_by(cantica,canto) %>% 
        summarize(nterzine = n_distinct(testo_terzine),
                  nversi = n_distinct(testo_versi)) %>% 
        ungroup() %>% 
        mutate(canto = reorder(canto,desc(canto)),
               cantica=factor(cantica,levels=c("inferno","purgatorio","paradiso"))) %>% 
        separate(canto, c("a", "canto"))
    
    
    #SUMMARY
    #SUMMARY
    #SUMMARY -------
    
    output$totCantiche <- renderValueBox({
        valueBox(
            3, 
            "Tot Cantiche", icon = icon("book"),
            color = "green"
        )
    })  
    
    output$totCanti <- renderValueBox({
        valueBox(
            totcanti, 
            "Tot Canti", icon = icon("book-open"), color = "green"
        )
    })  
    
    output$totVerses <- renderValueBox({
        valueBox(
            totversi, 
            "Tot Verses", icon = icon("paragraph"), color = "green"
        )
    })
    
    output$totWords <- renderValueBox({
        valueBox(
            totparole, 
            "Tot Words", icon = icon("text-width"), color = "green"
        )
    })
    
    output$totDistWords <- renderValueBox({
        valueBox(
            totparoledist, 
            "Tot Dist Words", icon = icon("text-width"), color = "green"
        )
    })
    
    #output$dante_wc <- renderUI(HTML('<p class="image-container" style="background: url(&quot;data:image/png;base64,&quot;) center center / contain no-repeat;"><img src="data:image/png;base64," width="576" data-figure-id="fig1"></p>'))
    
    output$info_ovw <- renderUI(HTML('<div class="chart-stage">
<p>The whole text has been pre-processed, in particular:</p>
<ul>
<li><p><strong>Lemmatisation</strong></p>
<ul>
<li><p>Lemmatisation is the process of grouping together the inflected forms of a word so they can be analysed as a single item, identified by the word’s lemma, or dictionary form. For example:</p>
<ul>
<li><em>good</em> <em>better</em> <em>best</em> -&gt; <em>good</em></li>
<li><em>have</em> <em>has</em> <em>had</em> -&gt; <em>have</em></li>
</ul></li>
</ul></li>
<li><p><strong>StopWords removal</strong></p>
<ul>
<li>Some words (aka <em>stopwords</em>) are filtered out because too frequent and considered not important for the analysis, for example: <em>“negl”, “stavano”, “faceva”, “una”, “con”</em></li>
<li>Stopwords list depends on analysis, so the stoplist can be changed.</li>
</ul></li>
</ul>
</div>'))

    output$guides_ovw <- renderUI(HTML('<div class="chart-stage">
<p>Please refers to this <a href="matteolocatelli.com/lab.html#divinacommedia">site</a> for mission and guidelines.</p>
</div>'))
    
    output$triplets_cantica <- renderPlotly({
        ggplotly(
            ggplot(kpi_cantiche_canti %>% arrange(as.roman(canto)), 
                   aes(canto,nterzine, fill = cantica
                   )) + 
                geom_bar(stat="identity") + 
                facet_wrap(~cantica, scales="free") + 
                coord_flip() +
                scale_fill_manual("legend", 
                                  values = c("inferno" = "#65000b", 
                                             "purgatorio" = "blue", 
                                             "paradiso" = "gold"))
            #    theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust=1))
        )
    })
    
    output$table_ovw <- renderDT(parole_clean %>%
                                     group_by(word) %>%
                                     summarize(freq = sum(freq)) %>%
                                     select(word,freq) %>%
                                     arrange(desc(freq)),
                                 filter = "top",
                                 options = list(
                                     pageLength = 5
                                 )
    )
    
    output$verses_cantica <- renderPlotly({
        ggplotly(
            ggplot(kpi_cantiche_canti %>% arrange(as.roman(canto)), 
                   aes(canto,nversi, fill = cantica
                   )) + 
                geom_bar(stat="identity") + 
                facet_wrap(~cantica, scales="free") + 
                coord_flip() +
                scale_fill_manual("legend", 
                                  values = c("inferno" = "#65000b", 
                                             "purgatorio" = "blue", 
                                             "paradiso" = "gold"))
            #    theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust=1))
        )
    })
    
    # FOCUS CANTICA ------
    
    output$table_inferno <- renderDT(parole_clean %>% 
                                         filter(cantica == 'inferno') %>% 
                                         select(word,freq) %>% 
                                         arrange(desc(freq)),
                                 filter = "top",
                                 options = list(
                                     pageLength = 5
                                 )
    )
    
    output$table_purgatorio <- renderDT(parole_clean %>% 
                                         filter(cantica == 'purgatorio') %>% 
                                         select(word,freq) %>% 
                                         arrange(desc(freq)),
                                     filter = "top",
                                     options = list(
                                         pageLength = 5
                                     )
    )
    
    output$table_paradiso <- renderDT(parole_clean %>% 
                                         filter(cantica == 'paradiso') %>% 
                                         select(word,freq) %>% 
                                         arrange(desc(freq)),
                                     filter = "top",
                                     options = list(
                                         pageLength = 5
                                     )
    )
    
    # TFIDF -------
    
    output$info_tfidf <- renderUI(HTML('<p>In information retrieval, <strong>TF-IDF</strong>, short for term frequency–inverse document frequency, is a numerical statistic that is intended to reflect how important a word is to a document in a collection.<br> The tf–idf value increases proportionally to the number of times a word appears in the document and is offset by the number of documents in the corpus that contain the word, which helps to adjust for the fact that some words appear more frequently in general.</p>'))
    output$comments_tfidf <- renderUI(HTML('<div class="chart-stage">

<p>TFIDF helps us see how word choice changes for each cantica.</p>
<p>In Paradiso the most important words are Cristo, Ridere (to laugh), Letiza (gladness) while in Inferno the most important words are Bolgia (bedlam), Pena (punishment), Fiera (in this case means <em>obstruction</em>). From these words you can already guess the ambient and feeling that distinguishes the canticles</p>
</div>'))
    
    output$tfidf_inferno <- renderPlotly({
        ggplotly(
            parole_clean %>% 
                filter(cantica == 'inferno') %>% 
                top_n(19,tf_idf) %>% 
                mutate(word = fct_reorder(word, tf_idf)) %>%
                ggplot(aes(x = tf_idf, y = word)) + geom_col(fill = "#65000b") + 
                theme(legend.position="none")
        )
    })
    
    output$tfidf_purgatorio <- renderPlotly({
        ggplotly(
            parole_clean %>% 
                filter(cantica == 'purgatorio') %>% 
                top_n(19,tf_idf) %>% 
                mutate(word = fct_reorder(word, tf_idf)) %>%
                ggplot(aes(x = tf_idf, y = word)) + geom_col(fill = "#224afb") + 
                theme(legend.position="none")
        )
    })
    
    output$tfidf_paradiso <- renderPlotly({
        ggplotly(
            parole_clean %>% 
                filter(cantica == 'paradiso') %>% 
                top_n(19,tf_idf) %>% 
                mutate(word = fct_reorder(word, tf_idf)) %>%
                ggplot(aes(x = tf_idf, y = word)) + geom_col(fill = "#fcd733") + 
                theme(legend.position="none")
        )
    })
    
    # text summary ------
    
    source_python('extract_summary.py')
    
    output$summary_text <- renderUI({ 
        if (input$cantica != 'inferno' & input$canto == "CANTO XXXIV") {
            input$canto == "CANTO XXXIII"
        }
        HTML(
            paste0("<h2>Summary</h2>",
                   "- ",
                generate_summary(input$cantica,input$canto,as.integer(input$nrighe))[[2]] %>% str_replace_all("\n","<br>")
        )
        )
    })
    
    # quiz ------
    
    source_python('extract_summary.py')
    
    testo <- eventReactive(input$do, {
        
        cantica_button <<- sample(c("inferno","purgatorio","paradiso"), 1)
        canto_button <<- sample(paste0("CANTO ",as.roman(seq(1,33))), 1)
        
        print(cantica_button)
        print(canto_button)
        
        testo <- HTML(
            paste0("<h2>Summary</h2>",
                   "- ",
                   generate_summary(cantica_button,canto_button,
                                    as.integer(input$nrighe2))[[2]] %>% str_replace_all("\n","<br>")
            )
        )
    })
    
    soluzione <- eventReactive(input$do2, {
        #cantica_button <- sample(c("inferno","purgatorio","paradiso"), 1)
        #canto_button <- sample(paste0("CANTO ",as.roman(seq(1,33))), 1)
        
        print("ciao")
        print(cantica_button)
        print(canto_button)
        
        soluzione <- HTML(
            paste0("<h2>Solution</h2>",
                   "<br>Cantica: ",cantica_button,
                   "<br>Canto: ",canto_button
            )
        )
    })
    
    output$quiz_text <- renderUI({ 
        testo()
    })
    
    output$solutions_text <- renderUI({ 
        soluzione()
    })
    
}

# Run the application 
shinyApp(ui = ui, server = server)